var title_f32_46_33505="MUNE incremental stimulation";
var content_f32_46_33505=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEURO%2F51481&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEURO%2F51481&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 543px\">",
"   <div class=\"ttl\">",
"    Motor unit number estimation (MUNE) by the incremental stimulation method",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 523px; height: 463px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Setup for recording from the biceps brachii with proximal stimulation of the musculocutaneous nerve (right). Superimposed waveforms, obtained following a series of progressively increasing stimuli (top left), are shown with the full CMAP (bottom left). The amplitudes of each waveform increment are measured and then averaged to obtain the average SMUAP amplitude. The full CMAP amplitude is then divided by the average SMUAP amplitude to derive the MUNE.",
"    <div class=\"footnotes\">",
"     MUNE: motor unit number estimation; CMAP: compound muscle action potential; SMUAP: single motor unit action potential.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jeremy Shefner, MD, PhD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
