"  <div class=\"headingAnchor\" id=\"references\">",
"   <h1>",
"    REFERENCES",
"   </h1>",
"   <ol id=\"reference\">",
"    <li>",
"     <div class=\"reference\">",
"      Andriole G, Bostwick DG, Brawley OW, et al, &ldquo;Effect of Dutasteride on the Risk of Prostate Cancer,&rdquo;",
"      <i>",
"       N Engl J Med",
"      </i>",
