"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F223400\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Acts similar to acetylcholine, produces depolarization of the motor endplate at the myoneural junction which causes sustained flaccid skeletal muscle paralysis produced by state of accommodation that develops in adjacent excitable muscle membranes",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F223417\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Onset of action: I.M.: 2-3 minutes; I.V.: Complete muscular relaxation: 30-60 seconds",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Duration: I.M.: 10-30 minutes; I.V.: 4-6 minutes with single administration",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Rapidly hydrolyzed by plasma pseudocholinesterase",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine",
"    </p>",
"   </div>",
"  </div>",
"  <div id=\"topicAgreement\">",
"   Use of UpToDate is subject to the",
