var title_f32_46_33515="Causes of low QRS voltage";
var content_f32_46_33515=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F80629&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F80629&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Causes of low voltage QRS complexes",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        Adrenal insufficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Anasarca",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Artifactual or spurious, eg, unrecognized standardization of ECG at one-half the usual gain (ie, 5 mm/mV)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiac infiltration or replacement (eg, amyloidosis, tumor)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiac transplantation, especially with acute or chronic rejection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cardiomyopathy, idiopathic or secondary*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Chronic obstructive pulmonary disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Constrictive pericarditis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Hypothyroidism, usually with sinus bradycardia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Left pneumothorax (mid-left chest leads)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myocardial infarction, extensive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Myocarditis, acute or chronic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Normal variant",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Obesity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pericardial effusion",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pericardial tamponade, usually with sinus tachycardia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Pleural effusions",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Dilated cardiomyopathy may be associated with the combination of relatively low limb lead voltages and prominent precordial voltages.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
