var title_f32_46_33516="ACC AHA choice imaging risk I";
var content_f32_46_33516=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F74428&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F74428&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Cardiac stress imaging as the initial test for risk stratification of patients with chronic stable angina who are able to exercise",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class I - There is evidence and/or general agreement that cardiac stress imaging as the initial test for risk stratification of patients with chronic stable angina who are able to exercise should be performed in the following manner:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Among patients who do not have left bundle branch block or an electronically paced ventricular rhythm but have either an abnormal ECG or are taking digoxin, exercise myocardial perfusion imaging (MPI) or exercise echocardiography to identify the extent, severity, and location of ischemia.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Among patients with left bundle branch block or an electronically paced ventricular rhythm, dipyridamole or adenosine MPI.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Among patients with left bundle branch block, dobutamine stress echocardiography.*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; When assessing the functional significance of coronary lesions, exercise MPI or exercise echocardiography.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class IIb - The weight of evidence or opinion is less well established for the usefulness of cardiac stress imaging as the initial test for risk stratification of patients with chronic stable angina who are able to exercise in the following setting:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Exercise echocardiography in the presence of left bundle branch block.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Exercise, dipyridamole, or adenosis MPI or exercise or dobutamine echocardiography in patients who have a normal rest ECG and are not taking digoxin.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Class III - There is evidence and/or general agreement that cardiac stress imaging as the initial test for risk stratification of patients with chronic stable angina who are able to exercise is not useful in in the following settings:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Exercise MPI in the presence of left bundle branch block.",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Severe comorbidity that is likely to limit life expectation or prevent revascularization.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Modified from: Fleisher, LA, Beckman, JA, Brown, KA, et al. ACC/AHA 2007 guidelines on perioperative cardiovascular evaluation and care for noncardiac surgery: a report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing Committee to Revise the 2002 Guidelines on Perioperative Cardiovascular Evaluation for Noncardiac Surgery): developed in collaboration with the American Society of Echocardiography, American Society of Nuclear Cardiology, Heart Rhythm Society, Society of Cardiovascular Anesthesiologists, Society for Cardiovascular Angiography and Interventions, Society for Vascular Medicine and Biology, and Society for Vascular Surgery. Circulation 2007; 116:e418.",
"    </div>",
"    <div class=\"reference\">",
"     Data from Gibbons, RJ, Abrams, J, Chatterjee, K, et al. ACC/AHA 2002 guideline update for the management of patients with chronic stable angina--summary article: a report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Committee on the Management of Patients With Chronic Stable Angina). Circulation 2003; 107:149. Copyright 2003 by the American College of Cardiology and American Heart Association, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
